import { StyleSheet } from "react-native"

const gastoAgendadoStyle = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#2C3C51',
        color: '#2C3C51',
    },
    menuContainer:{
        flexDirection: 'row',
        top: 55,
    },
    texto1: {
        fontWeight: "bold",
        fontSize: 18,
        color: '#000',
    },
    back: {
        marginRight: 200,
    },

})

export default gastoAgendadoStyle;
